	sl := strings.Split("ves.io.schema.shape.bot_defense.bot_endpoint_policy.crudapi", ".")
	t := strings.Join(sl[:len(sl)-1], ".")
	url := fmt.Sprintf("%s/%s/Object/%s", c.baseURL, t, dReq.ObjectUid)

